import React from 'react';

const recipes = [
  {
    id: 1,
    title: 'Chicken Biryani',
  },
  {
    id: 2,
    title: 'Paneer Butter Masala',
  },
  {
    id: 3,
    title: 'Masoor Dal',
  },
  {
    id: 4,
    title: 'Aloo Gobi',
  },
  {
    id: 5,
    title: 'Gulab Jamun',
  },
];

const RecipeList = () => {
  return (
    <div>
      <h2>Recipe List</h2>
      <ul>
        {recipes.map((recipe) => (
          <li key={recipe.id}>
            {recipe.title}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default RecipeList;
